import { newStoriesURL } from "./apiEndPoints";
import axios from "axios";

export const getNewStoryIds = () => {
    return axios
        .get(newStoriesURL)
        .then((res) => {
            console.log(res);
        })
        .catch((err) => {
            console.log(err);
        });
};
